void OAIVoiceV1ConnectionPolicyTargetApi::updateConnectionPolicyTarget(const QString &connection_policy_sid, const QString &sid, const ::OpenAPI::OptionalParam<bool> &enabled, const ::OpenAPI::OptionalParam<QString> &friendly_name, const ::OpenAPI::OptionalParam<qint32> &priority, const ::OpenAPI::OptionalParam<QString> &target, const ::OpenAPI::OptionalParam<qint32> &weight) {
    QString fullPath = QString(_serverConfigs["updateConnectionPolicyTarget"][_serverIndices.value("updateConnectionPolicyTarget")].URL()+"/v1/ConnectionPolicies/{ConnectionPolicySid}/Targets/{Sid}");
    
    if (!_username.isEmpty() && !_password.isEmpty()) {
        QByteArray b64;
        b64.append(_username.toUtf8() + ":" + _password.toUtf8());
        addHeaders("Authorization","Basic " + b64.toBase64());
    }
    
    {
        QString connection_policy_sidPathParam("{");
        connection_policy_sidPathParam.append("ConnectionPolicySid").append("}");
        QString pathPrefix, pathSuffix, pathDelimiter;
        QString pathStyle = "simple";
        if (pathStyle == "")
            pathStyle = "simple";
        pathPrefix = getParamStylePrefix(pathStyle);
        pathSuffix = getParamStyleSuffix(pathStyle);
        pathDelimiter = getParamStyleDelimiter(pathStyle, "ConnectionPolicySid", false);
        QString paramString = (pathStyle == "matrix") ? pathPrefix+"ConnectionPolicySid"+pathSuffix : pathPrefix;
        fullPath.replace(connection_policy_sidPathParam, paramString+QUrl::toPercentEncoding(::OpenAPI::toStringValue(connection_policy_sid)));
    }
    
    {
        QString sidPathParam("{");
        sidPathParam.append("Sid").append("}");
        QString pathPrefix, pathSuffix, pathDelimiter;
        QString pathStyle = "simple";
        if (pathStyle == "")
            pathStyle = "simple";
        pathPrefix = getParamStylePrefix(pathStyle);
        pathSuffix = getParamStyleSuffix(pathStyle);
        pathDelimiter = getParamStyleDelimiter(pathStyle, "Sid", false);
        QString paramString = (pathStyle == "matrix") ? pathPrefix+"Sid"+pathSuffix : pathPrefix;
        fullPath.replace(sidPathParam, paramString+QUrl::toPercentEncoding(::OpenAPI::toStringValue(sid)));
    }
    OAIHttpRequestWorker *worker = new OAIHttpRequestWorker(this, _manager);
    worker->setTimeOut(_timeOut);
    worker->setWorkingDirectory(_workingDirectory);
    OAIHttpRequestInput input(fullPath, "POST");

    if (enabled.hasValue())
    {
        input.add_var("Enabled", ::OpenAPI::toStringValue(enabled.value()));
    }
    if (friendly_name.hasValue())
    {
        input.add_var("FriendlyName", ::OpenAPI::toStringValue(friendly_name.value()));
    }
    if (priority.hasValue())
    {
        input.add_var("Priority", ::OpenAPI::toStringValue(priority.value()));
    }
    if (target.hasValue())
    {
        input.add_var("Target", ::OpenAPI::toStringValue(target.value()));
    }
    if (weight.hasValue())
    {
        input.add_var("Weight", ::OpenAPI::toStringValue(weight.value()));
    }

    for (auto keyValueIt = _defaultHeaders.keyValueBegin(); keyValueIt != _defaultHeaders.keyValueEnd(); keyValueIt++) {
        input.headers.insert(keyValueIt->first, keyValueIt->second);
    }


    connect(worker, &OAIHttpRequestWorker::on_execution_finished, this, &OAIVoiceV1ConnectionPolicyTargetApi::updateConnectionPolicyTargetCallback);
    connect(this, &OAIVoiceV1ConnectionPolicyTargetApi::abortRequestsSignal, worker, &QObject::deleteLater);
    connect(worker, &QObject::destroyed, this, [this]() {
        if (findChildren<OAIHttpRequestWorker*>().count() == 0) {
            Q_EMIT allPendingRequestsCompleted();
        }
    });

    worker->execute(&input);
}

